import { Environment, PresentationControls, useGLTF } from "@react-three/drei";
import { Html } from "@react-three/drei";

const Laptop = () => {
  const laptop = useGLTF(
    "https://vazxmixjsiawhamofees.supabase.co/storage/v1/object/public/models/macbook/model.gltf"
  );
  return (
    <>
      <Environment preset="warehouse" />;
      <PresentationControls global polar={[-0.4, 0.2]} azimuth={[-0.4, 0.2]}>
        <primitive object={laptop.scene} position-y={-1.5} />;
        <Html wrapperClass="laptop" position={[0, 1.5, -1.5]}>
          <iframe src="https://new-bmi-calculator-dennislee.netlify.app/"></iframe>
        </Html>
      </PresentationControls>
    </>
  );
};
export default Laptop;
